import { Route, Link, NavLink, Switch } from "react-router-dom";
import QuoteList from "./components/quotes/QuoteList";
import QuoteForm from "./components/quotes/QuoteForm";

const App = () => {
  return (
    <div>
      <Route path="/all-quotes">
        <QuoteList />
      </Route>
      <Route path="/add-a-quote">
        <QuoteForm />
      </Route>
    </div>
  );
};

export default App;
